/*Table structure for table `tbl_product_kid` */

DROP TABLE IF EXISTS `tbl_product_kid`;

CREATE TABLE `tbl_product_kid` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'sku',
  `color` tinyint(3) DEFAULT NULL COMMENT '颜色',
  `year_old` tinyint(3) DEFAULT NULL COMMENT '适用年龄',
  `size` varchar(20) DEFAULT NULL COMMENT '大小',
  `price` decimal(10,0) DEFAULT NULL COMMENT '价格',
  `status` tinyint(3) DEFAULT NULL COMMENT '1有效 2无效',
  `add_time` datetime DEFAULT NULL,
  `add_operator` bigint(20) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `update_operator` bigint(20) DEFAULT NULL,
  `num` int(12) DEFAULT NULL COMMENT '库存量',
  `spu_id` bigint(20) DEFAULT NULL COMMENT '父类产品编号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tbl_product_kid` */

/*Table structure for table `tbl_product_size` */

DROP TABLE IF EXISTS `tbl_product_size`;

CREATE TABLE `tbl_product_size` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `product_id` bigint(20) DEFAULT NULL COMMENT '产品ID(spu)',
  `code` varchar(50) DEFAULT NULL COMMENT '码数（支持文字或数字XXL 和 120）',
  `status` tinyint(4) DEFAULT NULL COMMENT '1可用 2过期',
  `add_operator` bigint(20) DEFAULT NULL,
  `add_time` datetime DEFAULT NULL,
  `update_operator` bigint(20) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tbl_product_size` */

/*Table structure for table `tbl_product_type` */

DROP TABLE IF EXISTS `tbl_product_type`;

CREATE TABLE `tbl_product_type` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父类型',
  `name` varchar(100) DEFAULT NULL COMMENT '商品类型名',
  `add_time` datetime DEFAULT NULL COMMENT '添加时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `add_operator` bigint(20) DEFAULT NULL COMMENT '添加人',
  `update_operator` bigint(20) DEFAULT NULL COMMENT '更新人',
  `status` tinyint(3) DEFAULT NULL COMMENT '状态1有效 2无效',
  `image_url` varchar(100) DEFAULT NULL COMMENT '图片地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8;

