  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(300) DEFAULT NULL COMMENT '产品名称',
  `type` tinyint(3) DEFAULT NULL COMMENT '产品类型 见tbl_product_type',
  `add_time` datetime DEFAULT NULL COMMENT '添加时间',
  `add_operator` bigint(20) DEFAULT NULL COMMENT '添加人',
  `status` tinyint(3) DEFAULT NULL COMMENT '是否在售 1是 2否',
  `update_operator` bigint(20) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `detail` text COMMENT '商品描述',
  `show_price` decimal(10,0) DEFAULT NULL COMMENT '展示价格',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=80007 DEFAULT CHARSET=utf8;

